import "./index.css";

import { Component } from "react";

class Notes extends Component {
  state = { notesData: [] };

  render() {
    const { notesData } = this.state;
    const notesCount = notesData.count;
    return (
      <div className="bg-container">
        <h1 className="main-head">Notes</h1>
        <button className="button1" onClick={this.addListToLocalStorage}>
          Save {notesCount} Notes
        </button>
        <div className="notes-container">
          <h1 className="sub-text">New Notes</h1>
          <label for="noesTitle" className="remainder-input-label">
            Title
          </label>
          <input
            className="title-input"
            type="text"
            id="noesTitle"
            placeholder="Title"
          />
        </div>
      </div>
    );
  }
}

export default Notes;
